document.addEventListener("DOMContentLoaded", function (event) {

    // https://gist.github.com/oliyh/db3d1a582aefe6d8fee9
    function toDataURL(url, callback) {
        var xhr = new XMLHttpRequest();
        xhr.onload = function () {
            var reader = new FileReader();
            reader.onloadend = function () {
                callback(reader.result);
            }
            reader.readAsDataURL(xhr.response);
        };
        xhr.open('GET', url);
        xhr.responseType = 'blob';
        xhr.send();
    }

    const quest = (document.querySelector("#sample-captcha > p > strong").innerText).toLowerCase().replace(/ /g, '-');
    console.log("Quest: " + quest);
    const questMatch = data.filter(image => image.name.match(quest))
    console.log("Quest Match: " + questMatch.length);

    let id;
    for (let index = 0; index < 3; index++) {
        id = "visualCaptcha-img-" + index
        const base64 = toDataURL(document.getElementById(id).src)
        if (questMatch.filter(img => img.data === base64).length) break;
    }

    console.log(id);
    document.getElementById(id).click();
});